import axios from "axios";


const base_url='http://localhost:9877/api/employees/'
const post_url='http://localhost:9877/api/employees/save'
export const listEmployee=() => axios.get(base_url+'getAllEmployees');
export const createEmployee=(employee) => axios.post(post_url+'save',employee);
